queries.sql:
select a.*,b.*,c.* from webot_RECEIPTS a left join webot_CSR b on a.CSRUNIQ = b.CSRUNIQ 
        left join webot_PO c on b.CSRUNIQ = c.CSRUNIQ and a.POUNIQ=c.POUNIQ
        where (a.POSTINGSTAT = &#039;1&#039;) and 
        (b.CONTRACT like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.CTDESC like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.MANAGER like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.SALESNAME like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039;
        or b.PROJECT like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.PRJDESC like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.PONUMBERCUST like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.CUSTOMER like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039;
        or b.NAMECUST like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.EMAIL1CUST like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.CRMNO like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or b.ORDERDESC like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039;
         or b.CRMREMARKS like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039;  or c.PONUMBER like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or a.RECPNUMBER like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; or a.VDNAME like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; 
       or a.DESCRIPTIO like &#039;%SPARE PARTS FOR PULP MACHINE:%&#039; ) and
        (a.RECPDATE&gt;=20230101 and a.RECPDATE&lt;=20230731)
        order by a.RECPDATE asc

